pragma solidity ^0.5.0;

import "./zeppelin/Ownable.sol";

contract TrackItems is Ownable{

    struct Track{
      uint systemId;
      uint customer;
      string traceAction;
      string reportSource;
      string location;
      string itemIdentification;
      uint date;
    }

    Track[] private tracks;

    function registerTrack(uint _systemId, string memory _traceAction, string memory _reportSource,
        string memory _location, string memory _itemIdentification, uint _customer) public onlyOwner
    {
        Track memory track = Track({
            systemId:_systemId,
            traceAction:_traceAction,
            reportSource:_reportSource,
            location:_location,
            itemIdentification:_itemIdentification,
            date:now,
            customer:_customer
        });

        tracks.push(track);

        emit trackingRegistered( track.systemId, track.traceAction, track.reportSource,
           track.location, track.itemIdentification, track.customer, track.date );

    }

    function totalTracks() public view returns(uint)
    {
      return tracks.length;
    }

    event trackingRegistered(uint systemId, string traceAction, string  reportSource,
        string location, string itemIdentification, uint customer, uint date);


}
